function Homepage() {
  return (
    <div className="bg-cover min-h-screen relative" style={{ backgroundImage: `url(https://images.pexels.com/photos/1270184/pexels-photo-1270184.jpeg?auto=compress&cs=tinysrgb&w=600)` }}>
      <Header />
      {/* <img src={NeonBg} alt="background" className="" /> */}
      {/* <div className="relative z-10 flex flex-col h-full justify-between"> */}
      <div className="text-white font-serif items-start gap-6 mb-10f font-extrabold">
            <p className="text-4xl  bg-cover p-5 rounded-t-full rounded-b-full ">Welcome to my Blog Post Web</p>
          <h1 className="text-4xl">Chhon</h1>
          <h1 className="text-7xl">KimEag</h1>
          <p className="text-3xl">OW Student</p>
        <Footer />
        {/* </div> */}
      </div>
    </div>
  );
}

export default Homepage;
